%[text] %[text:anchor:H_3240] ## `try, catch` blocks
%[text] `try, catch`  -- Execute statements practice
A = rand(3) %[output:807f876e]
B = ones(5) %[output:6f72351d]
%%
C = [A; B] % Vertical concatenation (stacks arrays on top of each other) %[output:42564fd1]
%%
%[text] Recall: A rule for concatenating arrays is *dimensional compatibility*. When concatenating arrays vertically, they must have the **same number of columns**.
%%
%[text] Somes notes on `try/catch` blocks:
%[text] Referencing: [https://www.mathworks.com/help/matlab/ref/try.html](https://www.mathworks.com/help/matlab/ref/try.html) 
%[text] First, what is an `exception`? $\\rightarrow$ An exception is an event that disrupts the normal flow of a program's execution. It signals that something unexpected or abnormal has occurred, such as an **error**, that the program needs to **handle**.
%[text] In Matlab, an `MException` **object** is a Matlab exception; it's how Matlab represents errors.
%[text] - It's a structured way to capture and inspect what went wrong, especially within a `try,catch` block.
%[text] - The `MException` object, which is given the alias `ME` in a `try,catch` block, contains several properties or info about the error, such as:  \
imshow('MException object properties.png') %[output:070a099e]
%[text] Ref: [https://www.mathworks.com/help/matlab/ref/mexception.html](https://www.mathworks.com/help/matlab/ref/mexception.html) 
%%
%[text] %[text:anchor:H_9289] ### Predefined Exception
%[text] To access the full `MException` object that is thrown during a **concatenation error**, intentionally trigger the error and catch it using a `try, catch` block.
disp('--- Example 1: Trigger and Inspect a Concatenation Error ---') %[output:6b8aa6ec]
% Trigger and inspect a concatenation error
try %[output:group:13f468a5]
    C = [A, B]; % This will fail

catch ME
    disp('--- MException Details ---'); %[output:20f01011]
    disp(['Identifier: ', ME.identifier]); %[output:2318f6aa]
    disp(['Message: ', ME.message]); %[output:2821968d]
    disp('Stack Trace:'); %[output:228f79b5]
    disp(ME.stack); % stack is a structure showing where the error occured (file, function, line) %[output:09d58b20]
end %[output:group:13f468a5]
%[text] Brilliant!
%[text] I needed the above info in order to find the unique error ID (from `ME.identifier`)
%%
%[text] %[text:anchor:H_5630] ### Constructed Exception - Supplement Error Message
disp('--- Example 2: Constructed Exception - Supplement Error Message ---') %[output:9a349359]
try %[output:group:1beb64a5]
    C = [A; B]; %[output:2ad9d862]
catch ME
    if (strcmp(ME.identifier, 'MATLAB:catenate:dimensionMismatch')) % compare strings; returns 1 (true) if both arguments are identical
        msg = ['Dimension mismatch occurred: First argument has ', ...
            num2str(size(A,2)),' columns while second has ', ...
            num2str(size(B,2)),' columns.'];
        causeException = MException('MATLAB:myCode:dimension',msg); % Capture error information and stores it in the MException object 'causeException'
        ME = addCause(ME,causeException) % Record additional causes of exception; this line displays the exception properties and adds the %[output:62069948]
        % "custom" message defined above. The error info appends the ME
        % object with the 'causeException.'
    end
    rethrow(ME) % To terminate the program and redisplay the exception, end the 'catch' block with a 'rethrow' statement.
end %[output:group:1beb64a5]
%%
%[text] %[text:anchor:H_0f7a] ### Repackage Error as Warning
disp('--- Example 3: Repackage Error as Warning ---') %[output:2e7c572c]
try %[output:group:09f578bb]
    a = notaFunction(5,6);
catch
    warning('Problem using function. Assigning a value of 0.'); %[output:0b38ec8d]
    a = 0;
end %[output:group:09f578bb]
%%
%[text] %[text:anchor:H_4555] ### Handle Different Types of Errors
disp('--- Example 4: Handle Different Types of Errors ---') %[output:38fa1011]
try %[output:group:2ba5b2b9]
    a = notaFunction(5,6);
catch ME
    switch ME.identifier % Execute one of the several groups of statements
        case 'MATLAB:UndefinedFunction'
            warning('Function is undefined. Assigning a vlue of NaN.');
            a = NaN;
        case 'MATLAB:scriptNotAFunction'
            warning(['Attempting to execute script as function. '... %[output:17271ad7]
                'Running script and assigning output a value of 0.']); %[output:17271ad7]
            notaFunction;
            a = 0;
        otherwise
            rethrow(ME)
    end
end %[output:group:2ba5b2b9]
